import { View, Text } from 'react-native';
import React, { useContext } from 'react';
import { collection, addDoc } from 'firebase/firebase-storage';
import { AuthContext } from '../provider/AuthProvider';

export default async function TestScreen({ navigation }) {

    const { currentUser, db } = useContext(AuthContext);

    useEffect(() => {
        if(!currentUser){
          setTimeout(() => {
              navigation.navigate('AuthScreen');
          }, 0);
        }
      }, [currentUser]);

      try {
          await addDoc(collection(db, "User"), {
              id: '2',
              fullName: 'Rowan Akinstan',
              photoURL: 'https://res.cloudinary.com/dopzctbyo/image/upload/v1649587847/sample.jpg',
              phoneNumber: '02838837067',
              sex: false,
              age: 29,
              joinDate: new Date().getTime(),
          });
          console.log("Document written with ID: ");
      } catch (e) {
          console.error("Error adding document: ", e);
      }


    return (
    <View>
      <Text>TestScreen</Text>;
    </View>
  )
};
